U SUBTABLE[8][8][256][256];

void prepare() {
  for (int e = 0; e < 8; ++e) for (int f = e; f < 8; ++f) {
    for (int x = 0; x < 1 << 8; ++x) for (int y = 0; y < 1 << 8; ++y) {
      U &t = SUBTABLE[e][f][x][y];
      t = 0;
      for (int p = 0; p < 8; ++p) {
        if (x & 1 << p) {
          for (int q = 0; q < 8; ++q) {
            if (y & 1 << q) {
              t ^= TABLE[e * 8 + p][f * 8 + q];
            }
          }
        }
      }
    }
  }
  for (int e = 0; e < 8; ++e) for (int f = 0; f < e; ++f) {
    for (int x = 0; x < 1 << 8; ++x) for (int y = 0; y < 1 << 8; ++y) {
      SUBTABLE[e][f][x][y] = SUBTABLE[f][e][y][x];
    }
  }
}

U mul(U a, U b) {
  U c = 0;
  for (int e = 0; e < 8; ++e) for (int f = 0; f < 8; ++f) {
    c ^= SUBTABLE[e][f][(a >> (e * 8)) & 255][(b >> (f * 8)) & 255];
  }
  return c;
}


int main() {
  prepare();

  int numCases;
  for (; ~scanf("%d", &numCases); ) {
    for (int caseId = 0; caseId < numCases; ++caseId) {
      U A, B;
      scanf("%llu%llu", &A, &B);
      const U ans = mul(A, B);
      printf("%llu\n", ans);
    }
  }
  return 0;
}
